import React from 'react';
import { View, Text, Image, ScrollView, StyleSheet } from 'react-native';

const Profile = () => {
  return (
    <ScrollView>
      <View style={styles.container}>
        <View style={[styles.box, styles.leftBox]}>
          <Text style={styles.boxTitle}>Previous Game List</Text>
          {/* Add previous game list content here */}
        </View>

        <View style={styles.middleBox}>
          <View style={styles.upperMiddle}>
            <Text style={styles.boxTitle}>Welcome, User Name</Text>
          </View>

          <View style={styles.middleMiddle}>
            <Image
              source={{ uri: 'https://example.com/fake-pic.jpg' }}
              style={styles.image}
            />
          </View>

          <View style={styles.lowerMiddle}>
            <Text style={styles.boxTitle}>Assigned Groups</Text>
            <Text>Group One</Text>
            <Text>Group Two</Text>
            <Text>Group Three</Text>
            {/* ... Add more options as needed */}
          </View>
        </View>

        <View style={[styles.box, styles.rightBox]}>
          <Text style={styles.boxTitle}>Upcoming Game List</Text>
          {/* Add upcoming game list content here */}
        </View>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexDirection: 'column',
  },
  box: {
    flex: 1,
    backgroundColor: 'white',
    borderColor: 'black',
    borderWidth: 1,
    borderRadius: 10,
    padding: 10,
    margin: 10,
  },
  leftBox: {
    flex: 1,
    width: 15,
  },
  middleBox: {
    flex: 1,
    flexDirection: 'row',
    alignItems: 'center'
  },
  upperMiddle: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  middleMiddle: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  lowerMiddle: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  rightBox: {
    flex: 1,
    width: 15,
    alignItems: 'center',
  },
  boxTitle: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  image: {
    width: 200,
    height: 200,
  },
});

export default Profile;
